==table map==
===quick tutorial on template===
&lt;pre>{{mapcell|Kingdom End|Boron|0|1|1|0}}&lt;/pre> 
is an example call.&lt;br>
mapcell is the template.&lt;br>
Kingdom End is the sector name&lt;br>
Boron is the owning faction.&lt;br>
|0|1|1|0 refers to top, right, bottom, left. or north, east, south, west, the 1 means that there's a gate on that side, a 0 means there isn't.
If you don't know, there's a copy of the html from rohrbecka's map below, which you can use for reference, although it's pretty hard to read. I'd suggest using the linked materials.
[[User:Madned|Madned]] 02:06, 11 February 2012 (CST)


one thing I'd like to do differently from other maps is to section off the overlapping chunks. for example the earth sectors should probably just be in their own section and then just jumped to with anchors &lt;nowiki>[[Universe Map#Earth Sectors]]&lt;/nowiki> not sure how well that will work inside the table itself though. ie: shareholder's fortune.

the mapcell templates are pretty easy to use, but a bit of pain to mass update. may make a second variant, changing the arguement order a little.

this does kinda violate conventional grid coordinate mapping though.

Also, someone probably ought to update the gate links on the sector pages. [[User:Madned|Madned]] 22:20, 10 February 2012 (CST)

The other thing that needs work on this map, other than completing the cell fill in. is probably fiddling with the cell sizes. didn't get around to it and the fill in seemed more important. but a consistent cell size would help the map look more polished. [[User:Madned|Madned]] 22:31, 10 February 2012 (CST)

