I'm coming to the conclusion that we need to bang one together for this site using internal links.

At least then it'll only be a question of this site going down and not vagaries of the internet. On the upside we have most of the data already. yay! on the downside the table structure's likely to be atrocious. ugh! 

This is not to say this page shouldn't include links to external tools and information. just that this wiki could probably use it's own map as it'd help visualize the sector arrangements and give a nice point for interaction. option two would be use an image map linking system for the links.
[[User:Madned|Madned]] 20:28, 10 February 2012 (CST)
